import './App.css';
import Contactinfo from './components/Contactinfo';

class App extends Component {
  constructor() {
    super();

    this.state = {
      task: "",
      tasks: [],
    };

    this.removeTask = this.removeTask.bind(this);
  }

  render() {
  return (
    <div className="App">
      <Contactinfo></Contactinfo>
    </div>
  );
  }
}

export default App;
